import React from 'react';
import './FeaturedEvents.css';

function FeaturedEvents() {
  // Sample static featured events data
  const events = [
    { id: 1, title: 'Global Hackathon 2024', date: '2024-07-10', description: 'Join the biggest global hackathon and showcase your skills.' },
    { id: 2, title: 'AI Innovation Challenge', date: '2024-08-05', description: 'Compete in our AI challenge to build innovative solutions.' },
    { id: 3, title: 'Open Source Sprint', date: '2024-09-15', description: 'Contribute to open source projects in a collaborative sprint.' },
  ];

  return (
    <section className="featured-events-section" data-aos="fade-up">
      <div className="container">
        <h2>Featured Events</h2>
        <ul className="events-list">
          {events.map(event => (
            <li key={event.id} className="event-item">
              <h3>{event.title}</h3>
              <p className="event-date">{event.date}</p>
              <p>{event.description}</p>
            </li>
          ))}
        </ul>
      </div>
    </section>
  );
}

export default FeaturedEvents;
